script: |
  super -f text -I q685.spq | sort > q685.out

inputs:
  - name: q685.spq
    data: |
      SELECT ALL - col0 - - - col1 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE NOT NULL NOT BETWEEN NULL AND col0 * + col2 * - CAST ( ( - col2 ) AS INTEGER );
  - name: tab0

outputs:
  - name: q685.out
    data: |
